import React from "react"

export default class SingleMovie extends React.Component{

  constructor(){
      super()

  }

  render(){

    const imgStyle = {
      width: "32px",
      height: "32px"
    }

    const title = {
      fontFamily: "verdana"
    }

    const description = {
      fontFamily: "verdana",
      color: "#4b5865",
      fontSize: "12px"
    }

    const infoDiv = {
      marginLeft: "20px"
    }

    return(
      <div className="singleMovieContent">
        <div>
          <img style={imgStyle} src="http://www.pngall.com/wp-content/uploads/2016/05/Trollface.png"/>
        </div>

        <div style={infoDiv}>
          <div style={title}>Game of thrones</div>
          <div style={description}>6.6 Rating, 2011</div>
        </div>
      </div>
    )
  }

}
